import './App.css';
import { Button } from 'react-bootstrap';


function App() {
  return (
    <div>
      <header>
        <h1>Send a reminder to your future self</h1>
        <Button variant="contained">Get Started</Button>
      </header>
    </div>
  );
}

export default App;
